import react from "react";
import { useState } from "react";
import { useNavigate } from "react-router-dom";
import './teams.css'

function Team({ team1, matches, wins, loses, draws }) {

}

function getInput()
{
    const [teamName, setName] = use
}

export default function TeamsPage({ isAdmin }) {
    const navigate = useNavigate();
    function handleClickTeams() {
        navigate('/teams')
    }
    function handleClickMatches() {
        navigate('/matches')
    }
    function handleClickTables() {
        navigate('/tables')
    }

    function handleLogout() {
        sessionStorage.removeItem("accessToken");
        sessionStorage.removeItem("refreshToken");
        localStorage.removeItem("isAdmin");
        navigate('/login');
    }

    return (
        <>
            <div className="content-teams">
                <div className="container-teams">
                    <header className='header'>
                        <h2 className='logo'>Sportify</h2>
                        <div className='nav'>
                            <ul>
                                <li onClick={handleClickTeams
                                }>Teams</li>
                                <li onClick={handleClickMatches}>Matches</li>
                                <li onClick={handleClickTables}>Tables</li>
                            </ul>
                        </div>
                        {isAdmin && (
                            <button class="button-4" role="button" onClick={handleLogout}>Logout</button>
                        )}
                    </header>
                    <div class="form">
                        <div class="title">Hi!</div>
                        <div class="subtitle">Let's create a team</div>

                        <div class="input-container ic1">
                            <input id="firstname" class="input" type="text" placeholder="Name of the Team" />
                        </div>
                        <div class="input-row">
                            <div class="input-container ic2">
                                <input id="input1" class="input" type="text" placeholder="Player 1" />
                            </div>
                            <div class="input-container ic2">
                                <input id="input2" class="input" type="text" placeholder="Player 2" />
                            </div>
                            <div class="input-container ic2">
                                <input id="input3" class="input" type="text" placeholder="Player 3" />
                            </div>
                        </div>

                        <div class="input-row">
                            <div class="input-container ic2">
                                <input id="input4" class="input" type="text" placeholder="Player 4" required/>
                            </div>
                            <div class="input-container ic2">
                                <input id="input5" class="input" type="text" placeholder="Player 5" />
                            </div>
                            <div class="input-container ic2">
                                <input id="input6" class="input" type="text" placeholder="Player 6" />
                            </div>
                        </div>

                        <div class="input-row">
                            <div class="input-container ic2">
                                <input id="input7" class="input" type="text" placeholder="Player 7" />
                            </div>
                        </div>
                        <button type="submit" class="submit">Submit</button>
                    </div>
                </div>
            </div>
        </>
    );
}
